import React, { useState } from 'react';
import { 
  AppBar,
  Toolbar,
  IconButton,
  Typography, 
  Box, 
  TextField, 
  Paper,
  Menu,
  MenuItem,
  Container,
  Tooltip,
  Avatar
} from '@mui/material';
import {
  Menu as MenuIcon,
  Logout as LogoutIcon,
  AccountCircle,
  Settings,
  Help
} from '@mui/icons-material';
import SendIcon from '@mui/icons-material/Send';
import { useNavigate } from 'react-router-dom';

const Home = () => {
  const navigate = useNavigate();
  const [anchorEl, setAnchorEl] = useState(null);
  const open = Boolean(anchorEl);

  const handleMenu = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  const handleLogout = () => {
    localStorage.removeItem('user');
    navigate('/login');
  };

  const [thought, setThought] = useState('');
  const [thoughts, setThoughts] = useState([]);

  const handleShareThought = (e) => {
    e.preventDefault();
    if (thought.trim()) {
      setThoughts([...thoughts, { id: Date.now(), text: thought }]);
      setThought('');
    }
  };

  return (
    <React.Fragment>
      <Box sx={{ display: 'flex', flexDirection: 'column', height: '100vh' }}>
        <AppBar position="static" color="default" elevation={1}>
          <Toolbar>
            <IconButton
              size="large"
              edge="start"
              color="inherit"
              aria-label="menu"
              sx={{ mr: 2 }}
              onClick={handleMenu}
            >
              <MenuIcon />
            </IconButton>
            <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
              Thoughts
            </Typography>
            <Box sx={{ display: 'flex', alignItems: 'center' }}>
              <Tooltip title="Logout">
                <IconButton
                  size="large"
                  aria-label="account of current user"
                  aria-controls="menu-appbar"
                  aria-haspopup="true"
                  onClick={handleLogout}
                  color="inherit"
                >
                  <LogoutIcon />
                </IconButton>
              </Tooltip>
            </Box>
          </Toolbar>
        </AppBar>

        <Menu
          id="menu-appbar"
          anchorEl={anchorEl}
          anchorOrigin={{
            vertical: 'top',
            horizontal: 'left',
          }}
          keepMounted
          transformOrigin={{
            vertical: 'top',
            horizontal: 'left',
          }}
          open={open}
          onClose={handleClose}
        >
          <MenuItem onClick={handleClose}>
            <Avatar sx={{ width: 24, height: 24, mr: 1 }}>
              <AccountCircle />
            </Avatar>
            Profile
          </MenuItem>
          <MenuItem onClick={handleClose}>
            <Settings fontSize="small" sx={{ mr: 1 }} />
            Settings
          </MenuItem>
          <MenuItem onClick={handleClose}>
            <Help fontSize="small" sx={{ mr: 1 }} />
            Help
          </MenuItem>
        </Menu>

        <Container maxWidth="md" sx={{ flex: 1, overflow: 'auto', py: 2 }}>
          <Box sx={{ mt: 2, mb: 4 }}>
            <Typography variant="h4" component="h1" gutterBottom align="center">
              Welcome to Thoughts
            </Typography>
            <Typography variant="h6" color="text.secondary" paragraph align="center">
              Your personal space to share and explore thoughts
            </Typography>
          </Box>

          {/* Thoughts List */}
          <Box sx={{ mt: 4, mb: 4 }}>
            {thoughts.map((item) => (
              <Paper 
                key={item.id} 
                elevation={2} 
                sx={{ 
                  p: 2, 
                  mb: 2, 
                  borderRadius: 2,
                  bgcolor: 'background.paper'
                }}
              >
                <Typography>{item.text}</Typography>
              </Paper>
            ))}
          </Box>
        </Container>

        {/* Fixed bottom input */}
        <Box 
          component="form" 
          onSubmit={handleShareThought}
          sx={{ 
            position: 'sticky', 
            bottom: 0, 
            py: 2, 
            bgcolor: 'background.default',
            borderTop: '1px solid',
            borderColor: 'divider',
            backdropFilter: 'blur(10px)'
          }}
        >
          <Container maxWidth="md">
            <Box sx={{ display: 'flex', gap: 1 }}>
              <TextField
                fullWidth
                variant="outlined"
                placeholder="Share your thoughts..."
                value={thought}
                onChange={(e) => setThought(e.target.value)}
                sx={{ 
                  '& .MuiOutlinedInput-root': {
                    borderRadius: '50px',
                    backgroundColor: 'background.paper',
                  }
                }}
                InputProps={{
                  endAdornment: (
                    <IconButton 
                      type="submit" 
                      color="primary"
                      disabled={!thought.trim()}
                    >
                      <SendIcon />
                    </IconButton>
                  ),
                }}
              />
            </Box>
          </Container>
        </Box>
      </Box>
    </React.Fragment>
  );
};

export default Home;
